import logo from './logo.svg';
import './App.css';
import { render } from '@testing-library/react';

function App() {
  function sayHello() {
    alert('Hello!');
  }

  return (
    <div className="App">
      <body>
        <p id="b"></p>
        <input id="a"></input>
        <button onClick={sayHello()}>Add Info</button>
        </body>
    </div>
  );
}

